INSERT INTO `tblclient_faqs` (`id`, `client_id`, `faq_id`, `cater_question`, `cater_answer`, `createdAt`) VALUES
(10, 98429, 88679, '<p>What are your payment and cancellation policies?</p>', '<p style=\"text-align: left;\"><strong>Gcash</strong> (Screenshot of Receipt) and <strong>Walk-in</strong> (Invoice)</p>\n<p style=\"text-align: left;\"><em><strong>Cancellations</strong> are accepted within 2 days of the initial request; afterward, no cancellations are processed, and it takes 2-3 business days for cancellation updates.</em></p>', '2024-04-20 00:00:04'),
(11, 98429, 94179, '<p>How far in advance should I book catering for my event?</p>', '<p><em>It\'s best to book catering services as early as possible to ensure availability, especially for large events.The system requires 1 month advance booking, but ideally 2-3 months is recommended.</em></p>', '2024-04-20 00:07:59'),
(12, 98429, 63661, '<p>Can you accommodate last-minute changes or additions to the guest count?</p>', '<p>We understand that guest counts may change leading up to the event. While it\'s best to provide final guest numbers in advance, we will do our best to accommodate last-minute changes whenever possible.</p>', '2024-04-20 05:34:58'),
(14, 78960, 63050, '<p>How far in advance should I book your catering services?</p>', '<p>We recommend booking as early as possible to secure your date.&nbsp; A one month\' notice is usually sufficient, but it depends on availability.</p>', '2024-09-02 05:13:29'),
(15, 17077, 51187, '<p><strong>TEST</strong></p>', '<p><strong>TEST</strong></p>', '2024-10-06 15:56:08'),
(16, 93970, 58003, '<p>What types of events do you cater?</p>', '<p>We cater to a wide range of events, including weddings, corporate events, birthday parties, anniversaries, family gatherings, and more.</p>', '2024-11-02 14:14:44'),
(17, 93970, 26754, '<p>How far in advance do I need to book your services?</p>', '<p>We recommend booking as early as possible to secure your date.&nbsp; A one month\' notice is usually sufficient, but it depends on availability.</p>', '2024-11-02 14:16:37'),
(18, 93970, 71850, '<p>What is included in the catering package?</p>\n<p>&nbsp;</p>', '<p>\"<strong>Enjoy complimentary catering setup for bookings of 100 guests or more.</strong>\"</p>\n<h3><strong>Elisam Catering &amp; Services Package for 100+ Guests</strong></h3>\n<h3><strong>Inclusions:</strong></h3>\n<ul>\n<li><strong>Backdrop</strong>: Customized theme with a silver laser sequin design, balloon garland, and artificial decorations; includes a \"Happy Birthday\" LED light.</li>\n<li><strong>Decorative Stand</strong>: 3 ft. tall stand with LED lighting.</li>\n<li><strong>Stage Setup</strong>: Elevated platform with a white couch for the celebrant.</li>\n<li><strong>VIP Seating</strong>: Tiffany chairs available upon request for VIP guests.</li>\n<li><strong>Decor Elements</strong>: Ribbon accents matching your chosen color motif.</li>\n<li><strong>Buffet Table</strong>: Decorated with roll-top chafing dishes and food warming lamps.</li>\n<li><strong>Full Catering Equipment</strong>: Includes plates, utensils, and glassware.</li>\n<li><strong>Grazing Table Setup</strong>: Stylishly decorated with a variety of display items.</li>\n<li><strong>Table and Chair Decorations</strong>: Includes motif-themed tablecloths, artificial floral centerpieces, and chair covers with ribbon accents.</li>\n<li><strong>Red Carpet</strong>: Elegant entry setup for guests.</li>\n<li><strong>Service Staff</strong>: Professional waiters and event stylists included.</li>\n</ul>\n<p>For any questions or suggestions, please feel free to call or message us. Let us know your requirements for a customized package.Thank you for considering our services!</p>', '2024-11-02 14:18:17'),
(19, 93970, 52185, '<p>Do you provide staff for serving?</p>', '<p>Yes, we offer professional staff for serving, bartending, and other needs during the event. Let us know your requirements, and we&rsquo;ll arrange the necessary personnel.</p>', '2024-11-02 14:19:31'),
(20, 93970, 39299, '<p>What are your payment terms and cancellation policy?</p>', '<p>A deposit is required upon booking, with the balance due before the event date. Cancellations made within a specific period may incur a fee. For detailed information, please refer to our policy.</p>', '2024-11-02 14:19:48'),
(21, 93970, 20006, '<p>What is the cost per person?</p>', '<p>&nbsp;Pricing varies depending on the menu chosen.</p>', '2024-11-02 14:22:48'),
(22, 78960, 85020, '<p>What is included in the catering package?</p>', '<p>\"<strong>Enjoy complimentary catering setup for bookings of 100 guests or more.</strong>\"</p>\n<h3><strong>Kagahin Resturant and Catering &amp; Services Package for 100+ Guests</strong></h3>\n<h3><strong>Inclusions:</strong></h3>\n<ul>\n<li><strong>Backdrop</strong>: Customized theme with a silver laser sequin design, balloon garland, and artificial decorations; includes a \"Happy Birthday\" LED light.</li>\n<li><strong>Decorative Stand</strong>: 3 ft. tall stand with LED lighting.</li>\n<li><strong>Stage Setup</strong>: Elevated platform with a white couch for the celebrant.</li>\n<li><strong>VIP Seating</strong>: Tiffany chairs available upon request for VIP guests.</li>\n<li><strong>Decor Elements</strong>: Ribbon accents matching your chosen color motif.</li>\n<li><strong>Buffet Table</strong>: Decorated with roll-top chafing dishes and food warming lamps.</li>\n<li><strong>Full Catering Equipment</strong>: Includes plates, utensils, and glassware.</li>\n<li><strong>Grazing Table Setup</strong>: Stylishly decorated with a variety of display items.</li>\n<li><strong>Table and Chair Decorations</strong>: Includes motif-themed tablecloths, artificial floral centerpieces, and chair covers with ribbon accents.</li>\n<li><strong>Red Carpet</strong>: Elegant entry setup for guests.</li>\n<li><strong>Service Staff</strong>: Professional waiters and event stylists included.</li>\n</ul>\n<p>For any questions or suggestions, please feel free to call or message us. Let us know your requirements for a customized package.Thank you for considering our services!</p>', '2024-11-14 06:53:43'),
(23, 78960, 49238, '<p>Do you provide staff for serving?</p>', '<p>Yes, we offer professional staff for serving, bartending, and other needs during the event. Let us know your requirements, and we&rsquo;ll arrange the necessary personnel.</p>', '2024-11-14 06:54:21'),
(24, 78960, 33735, '<p>What are your payment terms and cancellation policy?</p>', '<p>A deposit is required upon booking, with the balance due before the event date. Cancellations made within a specific period may incur a fee. For detailed information, please refer to our policy.</p>', '2024-11-14 06:54:46'),
(25, 78960, 93911, '<p>What is the cost per person?</p>', '<p>&nbsp;Pricing varies depending on the menu chosen.</p>', '2024-11-14 06:56:47'),
(26, 98429, 92218, '<p>What is included in the catering package?</p>', '<p>\"<strong>Enjoy complimentary catering setup for bookings of 100 guests or more.</strong>\"</p>\n<h3><strong>A&amp;J Catering &amp; Services Package for 100+ Guests</strong></h3>\n<h3><strong>Inclusions:</strong></h3>\n<ul>\n<li><strong>Backdrop</strong>: Customized theme with a silver laser sequin design, balloon garland, and artificial decorations; includes a \"Happy Birthday\" LED light.</li>\n<li><strong>Decorative Stand</strong>: 3 ft. tall stand with LED lighting.</li>\n<li><strong>Stage Setup</strong>: Elevated platform with a white couch for the celebrant.</li>\n<li><strong>VIP Seating</strong>: Tiffany chairs available upon request for VIP guests.</li>\n<li><strong>Decor Elements</strong>: Ribbon accents matching your chosen color motif.</li>\n<li><strong>Buffet Table</strong>: Decorated with roll-top chafing dishes and food warming lamps.</li>\n<li><strong>Full Catering Equipment</strong>: Includes plates, utensils, and glassware.</li>\n<li><strong>Grazing Table Setup</strong>: Stylishly decorated with a variety of display items.</li>\n<li><strong>Table and Chair Decorations</strong>: Includes motif-themed tablecloths, artificial floral centerpieces, and chair covers with ribbon accents.</li>\n<li><strong>Red Carpet</strong>: Elegant entry setup for guests.</li>\n<li><strong>Service Staff</strong>: Professional waiters and event stylists included.</li>\n</ul>\n<p>For any questions or suggestions, please feel free to call or message us. Let us know your requirements for a customized package.Thank you for considering our services!</p>', '2024-11-14 07:00:31'),
(27, 98429, 42863, '<p>Do you provide staff for serving?</p>', '<p>Yes, we offer professional staff for serving, bartending, and other needs during the event. Let us know your requirements, and we&rsquo;ll arrange the necessary personnel.</p>', '2024-11-14 07:01:15'),
(28, 49633, 68776, '<p>are you okay?</p>', '<p>yes</p>', '2024-11-15 08:44:47');
