INSERT INTO `tblclient_settings` (`id`, `client_id`, `cater_name`, `cater_description`, `bg_image`, `about_us`, `cater_location`, `cater_email`, `cater_contactno`, `socmed_link`, `cater_gmaplink`, `modifiedAt`) VALUES
(1, 78960, 'Kagahin Restaurant and Catering Services', '<p style=\"text-align: justify;\">&nbsp;A premier catering service located in the heart of Luisiana, Little Baguio of Laguna.</p>', 'bg2.jpg', '<p style=\"text-align: justify;\"><strong>Kagahin Catering is your partner in creating unforgettable events set against the cool, refreshing backdrop of Luisiana, Laguna, often called the &ldquo;Little Baguio of Laguna.&rdquo; Our town&rsquo;s crisp mountain air, scenic waterfalls, and abundant greenery serve as inspiration for every detail of our catering service, infusing each event with the charm and beauty of the landscape we call home. Here at Kagahin Catering, we specialize in transforming gatherings into meaningful moments by delivering an elevated dining experience with a unique blend of traditional Filipino cuisine enhanced with modern flavors.</strong></p>\n<p style=\"text-align: justify;\"><strong>Our culinary team, rooted in a deep appreciation for local flavors and culinary heritage, has crafted a menu that celebrates the richness of Filipino dishes while offering fresh twists that appeal to today&rsquo;s diverse tastes. Signature dishes range from time-honored Filipino classics such as Kare-Kare with a silky peanut sauce, savory Lechon Kawali with a crisp crackling, and rich Beef Caldereta, to modern takes like our vibrant Sinigang sa Pakwan, which combines the tangy tamarind broth with the sweetness of watermelon, and Grilled Pork Belly served with a special glaze inspired by the region&rsquo;s abundant citrus. Our desserts bring yet another level of delight, with classics like Buko Pandan and Mango Float, alongside our own twist on Turon, made with langka-infused cream and a hint of cinnamon.</strong></p>\n<p style=\"text-align: justify;\"><strong>Every detail of our service is thoughtfully planned to meet the needs of your event, from the setup and presentation to attentive staff who are dedicated to making sure every guest is warmly attended to. The Kagahin Catering experience goes beyond just food; it&rsquo;s a blend of culinary artistry, heartfelt service, and seamless coordination that lets you relax and enjoy every moment of your special day.</strong></p>\n<p style=\"text-align: justify;\"><strong>Whether you&rsquo;re celebrating a wedding, birthday, corporate event, or intimate family gathering, Kagahin Catering ensures an experience where you and your guests can truly savor not only delicious dishes but also the authentic essence of Luisiana&rsquo;s heritage. When you choose Kagahin Catering, you&rsquo;re not only choosing excellent food but a genuine experience that captures the soul of our beloved &ldquo;Little Baguio.&rdquo;</strong></p>', 'Luisiana, Laguna', 'kagahin99@gmail.com', '049-555-3190', 'https://www.facebook.com/kagahin.restaurant.and.catering.services', 'https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d775.8413740840585!2d121.51061314783969!3d14.18500388676014!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sph!4v1725951234365!5m2!1sen!2sph', '2024-04-15 16:25:11'),
(2, 93970, 'Elisam Catering Services', '<p style=\"text-align: justify;\">Transform events with TasteBuds\' culinary delights. Our portal offers easy reservation customization for unforgettable experiences.</p>', 'bg3.jpg', '<p style=\"margin: 0in; line-height: 200%; text-align: center;\">At <strong>Elisam Catering Services</strong>, we believe that every event is an opportunity to create unforgettable memories through exceptional food and service.</p>\n<p style=\"margin: 0in; line-height: 200%; text-align: center;\">With 23 years of experience in the industry, our team of passionate chefs and dedicated staff are committed to delivering&nbsp; excellence to your unique tastes and preferences.</p>\n<p style=\"margin: 0in; line-height: 200%; text-align: center;\">From intimate gatherings to grand celebrations, we take pride in crafting delicious menus using the finest ingredients sourced locally and globally.</p>\n<p style=\"margin: 0in; line-height: 200%; text-align: center;\">Our attention to detail, creativity, and personalized approach ensure that your event is not only a culinary delight but also a reflection of your vision and style.</p>\n<p style=\"margin: 0in; line-height: 200%; text-align: center;\">Let us turn your special occasion into an extraordinary culinary experience that will leave a lasting impression on you and your guests.</p>', 'Forest Park Subdivision Brgy Pinagbayanan Pila Laguna', 'rinaocaya6@gmail.com', '09262597182', 'https://www.facebook.com/ElisamCateringServices', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3867.0440693880896!2d121.35376037667582!3d14.250651686195317!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3397e3163256df6b%3A0xab6145cd090d5fc5!2sForest%20Park%20Village!5e0!3m2!1sen!2sph!4v1713', '2024-04-15 16:25:11'),
(3, 98429, 'ANJ Catering Services', '<p style=\"text-align: justify;\">Elevate events with Savor Cuisine\'s gourmet fare.&nbsp;Our portal simplifies reservations for seamless celebrations.</p>', 'hero-bg4.jpg', '<p style=\"text-align: justify;\">Welcome to ANJ Catering Service, where we bring flavors to life and make every event a memorable culinary experience.</p>\n<h4 style=\"text-align: justify;\">Our Story</h4>\n<p style=\"text-align: justify;\">ANJ Catering Service was founded with a passion for exquisite cuisine and a dedication to impeccable service. Established by <strong id=\"docs-internal-guid-c4503c02-7fff-356e-415d-3715a5ea7ef1\">Mrs. Jovy Larrios</strong>, our journey began with a simple idea: to create extraordinary dining experiences that delight the senses.</p>\n<h4 style=\"text-align: justify;\">Our Mission</h4>\n<p style=\"text-align: justify;\">At ANJ Catering Service, our mission is to exceed expectations with every dish we serve. We believe that food is more than sustenance; it\'s an art form. From intimate gatherings to grand celebrations, we bring creativity and passion to the table, ensuring each bite is a moment of culinary bliss.</p>\n<h4 style=\"text-align: justify;\">What Sets Us Apart</h4>\n<ul>\n<li style=\"text-align: justify;\">\n<p><strong>Artistry in Every Dish</strong>: Our chefs are masters of their craft, infusing each creation with innovation and flavor.</p>\n</li>\n<li style=\"text-align: justify;\">\n<p><strong>Personalized Service</strong>: We understand that every event is unique. That\'s why we work closely with our clients to tailor menus that reflect their tastes and preferences.</p>\n</li>\n<li style=\"text-align: justify;\">\n<p><strong>Quality Ingredients</strong>: We source only the freshest, finest ingredients to craft dishes that are as delicious as they are beautiful.</p>\n</li>\n<li>\n<p style=\"text-align: justify;\"><strong>Exceptional Attention to Detail</strong>: From the presentation of our dishes to the warmth of our service, we pay meticulous attention to every aspect of your event.</p>\n</li>\n</ul>', 'Purok 5 Balanga Pinagbayanan Pila Laguna', 'ArthuroLarrios@gmail.com', '09151581049', 'https://www.facebook.com/jovy.larrios.arthur?mibextid=ZbWKwL', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3867.0551838621777!2d121.35120457658059!3d14.250003286195858!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3397e1ccd5920615%3A0x21943d4ef3944d6d!2sUrban%20purok%205!5e0!3m2!1sen!2sph!4v1714905252', '2024-04-15 16:25:11'),
(15, 39918, 'Mameakami Catering Services', '<p>Offers delicious and beautifully presented catering options for events of all sizes. With a dedication to quality and customer satisfaction, to every celebration.</p>', 'BG.jpeg', '<p>MaMeaKaMi Catering Services was founded by a group of classmates with a shared dedication to exceptional food and service. Named after each of our team members &mdash; Manuel, Meassy, Karen, and Missy &mdash; we are located in Sambat, Sta. Cruz, and aim to bring unique, high-quality catering to every event. Our team specializes in crafting customized menus that highlight both local and international flavors, using only the finest ingredients for memorable dining experiences. Whether it&rsquo;s a small gathering or a large celebration, we&rsquo;re here to help make your event extraordinary with our professionalism and passion for hospitality.</p>', 'Pila, Laguna', 'missyicecheller@gmail.com', '09061851278', 'https://web.facebook.com/missy.rongavilla/', '', '2024-11-08 09:46:57'),
(22, 77696, 'AJ Catering Service', '<p>From traditional Filipino dishes to international cuisine, we offer a wide range of menu options that are sure to delight your guests and elevate your event experience.</p>', 'samm.jpg', '<p><strong>Why Choose Cater Joy?</strong></p>\n<ul>\n<li><strong>Customized Menus:</strong> We work with you to create a personalized menu that matches your taste, theme, and dietary requirements.</li>\n<li><strong>Fresh &amp; Local Ingredients:</strong> We believe in supporting local farmers and using the best ingredients for every dish we prepare.</li>\n<li><strong>Expert Event Coordination:</strong> Our team assists you from the planning stages to the final execution, ensuring your event is seamless and stress-free.</li>\n<li><strong>Professional Service:</strong> Our friendly, professional staff are committed to providing excellent service, ensuring your guests are well taken care of throughout your event.</li>\n</ul>\n<p>Let <strong>Cater Joy</strong> handle the catering, so you can focus on enjoying your event with friends, family, and colleagues. We&rsquo;re here to make every moment memorable.</p>', 'Luisiana, Laguna', 'manuel21@gmail.com', '09256894876', 'https://www.facebook.com', '', '2024-11-12 06:33:32'),
(25, 44331, 'KM Catering Services', '', '', '', '', 'sueannramirez101@gmail.com', '', '', '', '2024-11-12 16:55:37'),
(26, 49633, 'A&A', '<p>Lucas Pizza</p>', '462562444_1298673214492876_4983212733709757926_n.jpg', '<p>The hows of us</p>', 'Sambat Sta Cruz Laguna', 'edecronnie18@gmail.com', '09123456789', '', 'https://maps.app.goo.gl/wighpNezZk4ke4sM6', '2024-11-15 08:27:32');
